import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home-container">
      {/* Overlayed Background */}
      <div className="home-overlay">
        <div className="home-content">
          {/* Headline */}
          <h1>Expert Medical Care You Can Trust</h1>

          {/* Subheadline */}
          <p className="subheadline">
            Compassionate, reliable, and innovative healthcare solutions for you and your family.
          </p>

          {/* Key Highlights */}
          <div className="highlights">
            <div className="highlight">
              <h2>Comprehensive Services</h2>
              <p>From preventive care to advanced treatments, weâ€™ve got you covered.</p>
            </div>
            <div className="highlight">
              <h2>Advanced Technology</h2>
              <p>State-of-the-art diagnostics and treatments for precision care.</p>
            </div>
            <div className="highlight">
              <h2>Personalized Care</h2>
              <p>Tailored healthcare plans that prioritize your unique needs.</p>
            </div>
          </div>

          {/* Call-to-Action */}
          <div className="cta">
            <button className="cta-button">Book Now</button>
            <button className="cta-button">Contact Us</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
